import Heading from './Heading';
import Note from './Note';
import Footer from './Footer';
import CreateArea from './CreateArea';

function App() {
	return (
		<div>
			<Heading />
			<CreateArea />
			<Note key={1} title="Note title" content="Note content" />
			<Footer />
		</div>
	);
}

export default App;
